import styled from "styled-components";
import Text from "./ui-components/text";

const Wrapper = styled.div`
  min-height: 100vh;
  padding: 0 15px;
  display: flex;
  flex-direction: column;
`;

const RowContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`;

const GreenBlock = styled.div`
  background: #00FF7F;
  padding: 10px 15px;
`;

function App() {
    return (
        <Wrapper>
            <div style={{margin: "auto"}}>
                <Text color={"black"} fontSize={"44px"} fontWeight={600}>
                    Users
                </Text>
                <div style={{marginTop: "20px"}}>
                    <RowContainer>
                        <GreenBlock>
                            <Text>
                                Id
                            </Text>
                        </GreenBlock>
                        <GreenBlock>
                            <Text>
                                Email
                            </Text>
                        </GreenBlock>
                        <GreenBlock>
                            <Text>
                                Name
                            </Text>
                        </GreenBlock>
                        <GreenBlock>
                            <Text>
                                Surname
                            </Text>
                        </GreenBlock>
                        <GreenBlock>
                            <Text>
                                Id
                            </Text>
                        </GreenBlock>
                    </RowContainer>
                </div>
            </div>
        </Wrapper>
    );
}

export default App;
